// This is Contact component, it will contain contact form.
import React from "react";
import styled from "styled-components";
import Google from '../../MySite/googlemaps.png'
import Yelp from '../../MySite/yelp.png'

const ContactSection = styled.div`
width: 100vw;
padding: calc(2.5rem + 2.5vw) 0;
background-color: grey;
display:flex;
flex-direction: column;
justify-content: center;
align-items: center;
`
const Title = styled.h1`
display: inline-block;
font-size: calc(1rem + 1.5vw);
margin-top: 1rem;
margin-bottom: 3rem;
position: relative;
color: var(--purple);

&::before {
  content: '';
  height: 1px;
  width: 50%;
  position: absolute;
  left: 50%;
  bottom: 0;
  border-bottom: 2px solid var(--pink)
  transform: translate(-50%);
}
`
const Icons = styled.div`
  display: inline;
  margin-bottom: 3rem;
  a {
    &:not(:last-child) {
      margin-right: 2rem;
    }
  &:hover{
    img{
      filter: invert(50%) // sepia(100%) saturate(300%) 
    }
  }
  }
  img {
    width: 3rem;
    height: auto;
  }
`
const Contact = () => {
  return <ContactSection>
    <Title>Request Service</Title>
    <Icons>
      <a href="https://www.yelp.com/biz/major-appliance-repair-everett-2">
        <img src={Yelp} alt="Yelp" />
      </a>
      <a href="https://goo.gl/maps/ZLRVKagXNCkL9GPL9">
        <img src={Google} alt="Google" />
      </a>

    </Icons>
  </ContactSection>;
};

export default Contact;
